const Landing = () => {
    return ( 
    <div>
        <div style={{backgroundColor: 'red', display: flex}}>
            <h1>Language</h1>
            <h1>Icon</h1>
            <h1>LogIn /Sign In</h1>
        </div>
        <div style={{backgroundColor: 'blue'}}>
            <h1>title</h1>
            <h1>image</h1>
            <h1>scroll of data</h1>
            <h1>our solutions</h1>
            <h1>phrase</h1>
        </div>
        <div>
            <h1>Footer</h1>
        </div>
    </div> 
    );
}

export default Landing;
